import React from 'react';

const SubmitUser = () => {
  return(
    <form>
      <input type="text" value={this.state.name} onChange={ ({target}) => this.setState({message: target.value}) } />
      <button type="submit" onClick={e => {
        e.preventDefault();
      }} />
    </form>
  )
}

export default SubmitUser;
